import { createDrawerNavigator } from "@react-navigation/drawer";
import { NavigationContainer } from "@react-navigation/native";
import { StyleSheet, View } from "react-native";
import MessagesScreen from "./MessagesScreen.js";
import NewScreen from "./WeatherScreen.js";
import MoodScreen from "./MoodScreen.js";
import { Button } from "react-native-elements";

function HomeScreen({ navigation }) {
  return (
    <View style={styles.container}>
      <Button
        buttonStyle={styles.button}
        titleStyle={styles.title}
        onPress={navigation.openDrawer}
        title="Open navigation drawer"
      />
      <Button
  onPress={() => navigation.navigate("MessagesScreen")}
  title="Go to Message to Fife Rabbits"
/>
      <Button
        buttonStyle={styles.button}
        titleStyle={styles.title}
        onPress={() => navigation.navigate("Environment")}
        title="Go to check the Fife environment"
      />
      <Button
        buttonStyle={styles.button}
        titleStyle={styles.title}
        onPress={() => navigation.navigate("Mood Color")}
        title="Go to send you color of moods"
      />
    </View>
  );
}

const Drawer = createDrawerNavigator();

export default function App() {
  return (
    <NavigationContainer>
      <Drawer.Navigator initialRouteName="Home">
        <Drawer.Screen name="Home" component={HomeScreen} />
        <Drawer.Screen name="Message to Fife Rabbits" component={MessagesScreen} />
        <Drawer.Screen name="Mood Color" component={MoodScreen} />
        <Drawer.Screen name="Environment" component={NewScreen} />
      </Drawer.Navigator>
    </NavigationContainer>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: "center",
    justifyContent: "center",
  },
  button: {
    backgroundColor: "#0088cc",
    paddingVertical: 10,
    paddingHorizontal: 20,
    borderRadius: 5,
    marginVertical: 5,
  },
  title: {
    fontSize: 18,
    color: "white",
    textAlign: "center",
  },
});
